import axios from "axios"

export const getDriveTypes = () => {
    return axios.get(`DriveTypes`)
}

export const postDriveTypes = (driveType) => {
    return axios.post(`DriveTypes`, driveType)
}

export const putDriveType = (id, price) =>{
    return axios.put(`DriveTypes?id=${id}&&price=${price}`)
}

export const removeDriveType = (id) =>{
    return axios.delete(`DriveTypes?id=${id}`)
}
